const Search = ({ setInputValue }) => {
  return (
    <main class="container">
      <div class="search">
        <input
          type="text"
          id="countryInput"
          placeholder="Search by country"
          onChange={(event) => {
            setInputValue(event.target.value);
          }}
          required
        />
        <button class="btn-search"></button>
      </div>
    </main>
  );
};

export default Search;
